import React, { useEffect } from "react";
import axios from "axios";

const Reviews = () => {
  // const [results, setResults] = useState(null);

  const url = "https://maps.googleapis.com/maps/api/place/details/json";
  const place_id = "ChIJu05ObHdV2YARcw7PYoI0dqc";
  const apiKey = "AIzaSyAkEavPqM8mkgWd_hAA6vUYW1xfsmW9yEQ";

  useEffect(() => {
    const fetchData = async () => {
      const request = await axios.get(
        `${url}?place_id=${place_id}&fields=user_ratings_total&key=${apiKey}`
      );
      console.log(request);
      return request;
    };

    fetchData();
  }, []);

  return (
    <div id="reviews">
      <h3>Google says...</h3>
      <p id="rating">Overall Rating</p>
      <p id="number"># of Reviews</p>
    </div>
  );
};

export default Reviews;
